import { Link } from "react-router-dom";

export default function Home(){
  return (
    <div style={{padding:"40px",fontFamily:"Arial"}}>
      <h1 style={{color:"#0055aa"}}>Reputation Tracker</h1>
      <h3>Select Platform:</h3>
      <Link to="/twitter"><button>Twitter</button></Link><br/><br/>
      <Link to="/facebook"><button>Facebook</button></Link><br/><br/>
      <Link to="/instagram"><button>Instagram</button></Link><br/><br/>
      <Link to="/reddit"><button>Reddit</button></Link>
    </div>
  );
}
